-- ----------------------------
-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user`
(
    `id`               int NOT NULL AUTO_INCREMENT COMMENT '唯一标识',
    `real_name`        varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci  DEFAULT NULL COMMENT '用户真实姓名',
    `nick_name`        varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci  DEFAULT NULL COMMENT '用户昵称（花名）',
    `id_card`          varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci  DEFAULT NULL COMMENT '身份证',
    `avatar`           varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL COMMENT '用户头像',
    `sex`              varchar(2) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci   DEFAULT NULL COMMENT '性别：1男，0女',
    `address`          varchar(256) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL COMMENT '地址',
    `email`            varchar(128) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL COMMENT '邮箱',
    `mobile`           varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci  DEFAULT NULL COMMENT '手机号码',
    `tel`              varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci  DEFAULT NULL COMMENT '电话号码',
    `fax`              varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci  DEFAULT NULL COMMENT '传真号码',
    `sort`             int                                                           DEFAULT NULL COMMENT '排序',
    `remark`           varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL COMMENT '备注',
    `status`           char(2) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci      DEFAULT NULL COMMENT '人员状态：1正常，0不正常',
    `skins`            varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci  DEFAULT NULL COMMENT '皮肤风格',
    `org_id`           int                                                           DEFAULT NULL COMMENT '所在区域或者部门ID，多数据请用逗号隔开',
    `org_code`         varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci  DEFAULT NULL COMMENT '所在区域或者部门编码code，多数据请用逗号隔开',
    `create_time`      datetime                                                      DEFAULT NULL COMMENT '创建时间',
    `update_time`      datetime                                                      DEFAULT NULL COMMENT '更新时间',
    `login_nums`       int                                                           DEFAULT '0' COMMENT '登陆次数',
    `login_error_nums` int                                                           DEFAULT '0' COMMENT '登录失败次数',
    `login_time`       datetime                                                      DEFAULT NULL COMMENT '登录时间',
    `expire_time`      datetime                                                      DEFAULT NULL COMMENT '帐号超时期限',
    `create_id`        bigint                                                        DEFAULT NULL COMMENT '创建人',
    `update_id`        bigint                                                        DEFAULT NULL COMMENT '更新人',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=COMPACT COMMENT='用户表';

