-- ----------------------------
-- Table structure for sys_user_auths
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_auths`;
CREATE TABLE `sys_user_auths`
(
    `id`            int NOT NULL AUTO_INCREMENT COMMENT '唯一标识',
    `user_id`       int                                                           DEFAULT NULL COMMENT '关联用户ID',
    `identity_type` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci  DEFAULT NULL COMMENT '登录类型(手机号/邮箱/用户名/微信/微博/QQ）等',
    `identifier`    varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci  DEFAULT NULL COMMENT '登录标识(手机号/邮箱/用户名/微信/微博/QQ）等唯一标识，等同于登录账号',
    `credential`    varchar(500) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL COMMENT '密码凭证（自建密码，或者第三方access_token）',
    `verified`      char(2) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci      DEFAULT NULL COMMENT '是否已经验证：1验证，0未验证',
    `expire_time`   datetime                                                      DEFAULT NULL COMMENT '登录标识失效时间',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='用户授权信息表';

